import React from 'react'
import { NavItem } from 'react-bootstrap'
import Poll from './Poll'


const Pollslist = ({polls, setPolls}) => {
  return (
    <div className='container  w-50'>

      {polls.le}
      {polls.map((poll) => (
        
        <Poll 
            poll={poll}
            key={poll.id}/>

      ))}

    </div>
  )
}

export default Pollslist
